window.bookSummaryJSON = "<p><b>Build a dungeon. Command minions. Fulfill carnal desires with sexy monster girls...Pay the price for making a deal with a daemon.</b></p> <p>After being saved from his own execution by a deal-making daemon, Keaton is tasked with killing a dungeon lord. A straightforward task for a former assassin, but the moment Keaton's dagger plunges into the dungeon core crystal, he becomes the newest lord of The Labyrinth.</p> <p>What starts as a maze of useless caverns quickly turns into something respectable as Keaton uses his powers to craft defenses and facilities. But to truly grow his dungeon, he needs minions. And to control those minions, he needs lieutenants: Beautiful, monstrous women with strength and powers beyond his understanding.</p> <p>Enlisting the help of a meek but knowledgeable dragon girl and a fawn-like warrior goddess, Keaton delves into the dungeon of another lord hoping to plunder his way to advancement. But the rival lord's got a nasty trap in store for him, and Keaton's relationship with his girls may never be the same.</p> <p>...Assuming they can make it out alive.</p> <p><b>Contains mature themes.</b></p>"; 
